import React from "react";
import HomeDetails from "./HomeDetails";
const Card = () => {
  return (
    <>
      <div className="card ">
        <img src={HomeDetails.image} className="card-img-top" alt="..." />
        <div className="card-body">
          <h5 className="card-title text-center">{HomeDetails.item}</h5>
          <div className="row justify-content-around">
            <span className="card-text">{HomeDetails.amount}</span>
            <span className="">
              <button className="btn btn-primary ">Buynow</button>
            </span>
          </div>
        </div>
      </div>
    </>
  );
};

export default Card;
